import React from 'react'

const DUMMY_QUOTES = [
  {
    id: 'q1',
    author: 'Shakespeare',
    text: 'Paçocaaaaaaaaaa'
  },
  {
    id: 'q2',
    author: 'Shakespeare',
    text: 'Queijoooooooo'
  }
]

const AllQuotes = () => {
  return (
    <h1>AllQuotes</h1>
  )
}

export default AllQuotes
